/*
NHSBSA Official Statistics: Health Exemption Services
ICB Population Figures - ONS data
Version 1.0


AMENDMENTS:
	2024-06-05  : Steven Buckley    : Initial script created
    

DESCRIPTION:
    Identify the ICB population data as published by ONS
    
    For 2021 and 2022 ONS published the mid-year population estimates by the latest ICB classification structure
        https://www.ons.gov.uk/peoplepopulationandcommunity/populationandmigration/populationestimates/datasets/clinicalcommissioninggroupmidyearpopulationestimates
    
    For time periods prior to 2021 there are no published population figures by ICB as ICBs were introduced in 2022 and ONS have not retrospectively produced the figures.
    Therefore the ICB populations need to be calculated from LSOA population data using appropriate LSOA to ICB mappings.
        This approach was suggested following contact with the population information team at ONS (pop.info@ons.gov.uk)
        LSOA population data by age and sex is available from:
            https://www.ons.gov.uk/peoplepopulationandcommunity/populationandmigration/populationestimates/datasets/lowersuperoutputareamidyearpopulationestimates 
        LSOA to ICB mapping is available from:
            https://geoportal.statistics.gov.uk/maps/423c8069710c4d488d5ff99475688101
                         
    This script contains a table creation statement and insert statements based on data collated from the above sources.
*/
------------------------------------------------------------------------------------------------------------------------------------------------------
------------------------------------------------------------------------------------------------------------------------------------------------------
--------------------SCRIPT START----------------------------------------------------------------------------------------------------------------------

------------------------------------------------------------------------------------------------------------------------------------------------------
-----CREATE TABLE OBJECT------------------------------------------------------------------------------------------------------------------------------
create table HWHC_ONS_ICB_POPULATION
(
    POPULATION_YEAR             NUMBER(4,0), 
	GEOGRAPHY_TYPE              VARCHAR2(255 BYTE), 
	GEOGRAPHY_ONS_CODE          VARCHAR2(255 BYTE), 
	GEOGRAPHY_ALT_CODE          VARCHAR2(255 BYTE), 
	GEOGRAPHY_NAME              VARCHAR2(255 BYTE), 
	TOTAL_POPULATION            NUMBER, 
	POPULATION_16PLUS           NUMBER, 
	FEMALE_POPULATION_15_TO_45  NUMBER
)
;
-----CREATE TABLE OBJECT------------------------------------------------------------------------------------------------------------------------------
------------------------------------------------------------------------------------------------------------------------------------------------------


------------------------------------------------------------------------------------------------------------------------------------------------------
-----POPULATE TABLE-----------------------------------------------------------------------------------------------------------------------------------
commit;
-----POPULATE TABLE-----------------------------------------------------------------------------------------------------------------------------------
------------------------------------------------------------------------------------------------------------------------------------------------------


---------------------SCRIPT END-----------------------------------------------------------------------------------------------------------------------
